import './App.css';
import React from 'react';


function Welcome() {
  return (
    <div className="App">
   
   <div id="intro" class="bg-image shadow-2-strong">
      <div class="mask" style={{BackgroundColor: "rgba(0, 0, 0, 0.8)"}}>
        <div class="container d-flex align-items-center justify-content-center text-center h-100">
          <div class="text-white">
            <h1 class="mb-3">Learn Bootstrap 5 with MDB</h1>
            <h5 class="mb-4">Best & free guide of responsive web design</h5>
            <a class="btn btn-outline-light btn-lg m-2" href="https://www.youtube.com/watch?v=c9B4TPnak1A" role="button"
              rel="nofollow" target="blank">Start tutorial</a>
            <a class="btn btn-outline-light btn-lg m-2" href="https://mdbootstrap.com/docs/standard/" target="blank"
              role="button">Download MDB UI KIT</a>
          </div>
        </div>
      </div>
    </div>
    </div>
  );
}

export default Welcome;
